  `deleted_at` timestamp NULL DEFAULT NULL,
  `person_id` bigint unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `crimes_person_id_foreign` (`person_id`),
  CONSTRAINT `crimes_person_id_foreign` FOREIGN KEY (`person_id`) REFERENCES `people` (`id`)
